create table `groups`
(
    gr_seq             bigint       not null
        primary key,
    gr_agree           int          not null,
    gr_bgm_origin_name varchar(255) not null,
    gr_bgm_uuid_name   varchar(50)  not null,
    gr_headcount       int          not null,
    gr_invitation_code varchar(50)  not null,
    gr_name            varchar(20)  not null,
    gr_open_date_time  datetime(6)  not null
);

